import Header from '../header/Header.js';

function NotFound() {
    return (
      <div id="Home">
      <div id="Content">
        <header>
          <Header/>
        </header>
        <h1 id="not-found">Page not found</h1>
      </div>
    </div>
    );
  }

export default NotFound;
